import React from 'react';

const Following = ({ followingList }) => {
    return (
      <div>
        <h3>Following</h3>
        <ul>
          {followingList.map(follow => (
            <li key={follow.id}>{follow.name}</li>
          ))}
        </ul>
      </div>
    );
  };

  export default Following;
